package net.linxingyang.book.qo;import java.util.Set;import net.linxingyang.book.pojo.Booklist;public class BooklistQo extends Booklist{    private Integer page;    private Integer limit;    private String orderBy;        private Set<Integer> configIds;    private Integer configIdsLength = Integer.valueOf(0);    	public Integer getConfigIdsLength() {		return configIdsLength;	}	public void setConfigIdsLength(Integer configIdsLength) {		this.configIdsLength = configIdsLength;	}	public Set<Integer> getConfigIds() {		return configIds;	}	public void setConfigIds(Set<Integer> configIds) {		this.configIds = configIds;	}	public String getOrderBy() {        return orderBy;    }    public void setOrderBy(String orderBy) {        this.orderBy = orderBy;    }    public void setPage(Integer page) {        this.page = page;    }         public Integer getPage() {        return this.page;    }        public void setLimit(Integer limit) {        this.limit = limit;    }        public Integer getLimit() {        return this.limit;        }    }